def minAreaRect(points):
    from collections import defaultdict
    x_points = defaultdict(list)
    min_area = float('inf')
    for (x, y) in points:
        x_points[x].append(y)
    prev_x = {}
    for x in sorted(x_points):
        x_points[x].sort()
        for i in range(len(x_points[x])):
            for j in range(i):
                if (x_points[x][j], x_points[x][i]) in prev_x:
